#Tandy TP-10 Print Simulator

from PIL import Image, ImageOps
import math

class TP10:

  #Resolution Values
  dpi72 = 72
  dpi600 = 600
  
  #Internal Constants
  __columns = 32  #Number of characters on a line
  __elongate = chr(1)

  def __init__(self, debug=False):
    self.__debug = debug
    self.__chars72dpi = self.__buildchars(self.__size72dpi, self.__data72dpi)
    self.__masks72dpi = self.__buildchars(self.__size72dpi, self.__data72dpi, self.__mask72dpi)
    self.__chars600dpi = self.__buildchars(self.__size_600dpi, self.__data600dpi)
    self.__masks600dpi = self.__buildchars(self.__size_600dpi, self.__data600dpi, self.__mask600dpi)

  def print(self, text, dpi):
    """Process formatted text and return image representing a printed page."""
    lines = self.__buildlines(text)
    return self.page(lines, dpi)

  def __buildlines(self, text):
    elongated = False
    escaped = False
    repeat = False
    count = None
    lines = []
    line = ""
    prefix = ""
    wrapped = False
    for c in text:
      if (repeat and count == None):
        count = c
      elif (c > 255 or c<2 or c==127): 
        continue
      elif (escaped):
        if (c == 14): elongated = True
        elif (c == 15): elongated = False
        escaped = False
      elif (c == 10): 
        lines.append(prefix + line)      #Simulate LF without CR
        line = ' ' * len(line)
        prefix = ""
      elif (c == 13):
        if (not wrapped):
          lines.append(prefix + line)      #Simulate CR/LF
          line = ""
          prefix = ""
      elif (c == 26):
        prefix += line.ljust(32)
        line = ""               #Simulate CR without LF
        if (self.__debug): print('Prefix: "%s"' % prefix)
      elif (c == 27): escaped = True
      elif (c == 28): 
        repeat = True
      else:
        wrapped = False
        if (c < 32): c = 127
        if (repeat):
          for i in range(0,count):
            if (elongated): line += self.__elongate
            line += chr(c)
          repeat = False
          count = None
        else:
          if (elongated): line += self.__elongate
          line += chr(c)
        while (len(line) >= self.__columns):
          lines.append(prefix + line[0:32])
          line = line[32:]
          prefix = ""
          wrapped = True
    lines.append(prefix + line)
    if (self.__debug): print("Generated raw text ", lines)
    return lines

  #Build a page from lines of text
  def page(self, lines, dpi):
    """Process raw text and return image representing a printed page.
    
    Arguments:

    lines -- list of strings, each of which represents one line of raw text 
    to be printed. Up to 32 characters of each line is processed; any characters 
    beyond that are ignored. ASCII characters 0 through 31 are ignored and 144 
    through 255 are mapped to 128 through 143. ASCII character 127 causes the
    following character to be printed as elongated at the current position.

    dpi -- Output image resolution. Supported resolutions include 72 and 600 dpi.
    """
    self.__setdpi(dpi)
    rows = len(lines)
    page = self.__newpage(rows)
    row = 0
    for line in lines:
      if (self.__debug): print(row, line, len(line))
      elongated = False
      y = row * self.__height + self.__margin
      column = 0
      for char in line:
        x = column % self.__columns * self.__width + self.__margin
        c = ord(char)
        if (char == self.__elongate):
          elongated = True
          continue
        if (c > 127 and c < 255): c = c & 0b10001111
        i = c - ord(' ')
        if (i > 0 and i < len(self.__chars)):
          clip = self.__chars[i]
          mask = self.__masks[i]
          clip_width = self.__width
          if (elongated):
            clip_width *= 2
            clip = clip.resize((clip_width, self.__height))
            mask = mask.resize((clip_width, self.__height))
          box = (x, y, x + clip_width, y + self.__height)
          page.paste(clip, box, mask)
        if (elongated):
          column += 2
          elongated = False
        else:
          column += 1
      row += 1
    return page

  #Create Test Image
  def test(self, dpi, elongated=False):
    if (self.__debug): print("Generating Test Page")
    lines = []
    line = ""
    for i in range(0, 256):
      if (elongated):
        line += chr(127)
      char = chr(ord(' ') + i)
      line += char
      if (len(line) >= self.__columns):
        lines.append(line)
        line = ""
    if line:
      lines.append(line)
    if (self.__debug): print("Built lines %s", lines)
    return self.page(lines, dpi)
    return page

  def __newpage(self, rows):
    self.__rows = rows
    if (self.__debug): print("Creating page with %d rows" % self.__rows)
    self.__pageheight = self.__height * self.__rows + 2 * self.__margin
    self.__pagesize = (self.__pagewidth, self.__pageheight)
    page = Image.new(self.__mode, self.__pagesize, self.__color)
    if (self.__debug): print("New Page (size %d,%d)" % self.__pagesize)
    return page

  def getdata(self, dpi):
    dpi_type = type(dpi)
    if (dpi_type != int):
      raise TypeError("Invalid argument type %s" % dpi_type)
    if (dpi == self.dpi72):
      return self.__data72dpi
    elif (dpi == self.dpi600):
      return self.__data600dpi
    else:
      raise ValueError("Invalid argument %d" % dpi)

  #Validate and Set DPI variables
  def __setdpi(self, dpi):
    dpi_type = type(dpi)
    if (dpi_type != int):
      raise TypeError("Invalid argument type %s" % dpi_type)
    if (dpi == self.dpi72):
      self.__size = self.__size72dpi
      self.__chars = self.__chars72dpi
      self.__masks = self.__masks72dpi
    elif (dpi == self.dpi600):
      self.__size = self.__size_600dpi
      self.__chars = self.__chars600dpi
      self.__masks = self.__masks600dpi
    else:
      raise ValueError("Invalid argument %d" % dpi)
    self.__dpi = dpi
    (self.__width, self.__height) = self.__size
    self.__margin = self.__width
    self.__pagewidth = self.__width * self.__columns + 2 * self.__margin
    if (self.__debug): print("DPI set to %d" % self.__dpi)

  #Build Character Image List from Image Data
  def __buildchars(self, size, data_list, mask_byte=0):
    char_list = []
    mask_list = []
    for int_data in data_list:
      char = self.__buildchar(size, int_data, mask_byte)
      char_list.append(char)
    return char_list

  #Build Character Image from Integer Array
  def __buildchar(self, size, data_list, mask_byte):
      int_list = []
      for i in data_list:
         int_list.append(i ^ mask_byte)
      byte_data = bytes(int_list)
      return Image.frombytes(self.__mode, size, byte_data)
  
  #Invert 8 bit integer
  def __invert(self, i):
    return 255 - i

